import React from 'react';

require("es6-promise").polyfill();
require("isomorphic-fetch")
export default function Tabel({data})
{
    const columns = ["Name","Country","Latitude","Longitude","Wind Prob.","When to go"]
    const rows = data.map(dat => ({
        name : dat.name,
        country : dat.country,
        lat : dat.lat,
        long : dat.long,
        wind : dat.probability,
        month : dat.month
    })
    );
    console.log(rows.map(row => row.name))
    return(
        <div className="table-style">
        <table cellPadding={0} cellSpacing={0}>
            <thead>
                <tr>{columns.map((heading) => <th key={heading}>{heading}</th>)}</tr>
            </thead>
            <tbody>
               {rows.map(
                   row => <tr>
                       <td>{row.name}</td>
                       <td>{row.country}</td>
                       <td>{row.lat}</td>
                       <td>{row.long}</td>
                       <td>{row.wind}</td>
                       <td>{row.month}</td>
                       </tr>
               )}
            </tbody>
        </table>
        </div>
    )
}
